  select distinct v.id, v.histo_modification, vh.type_volume_horaire_id
  from volume_horaire vh 
  join validation_vol_horaire vvh on vvh.volume_horaire_id = vh.id 
  join validation v on v.id = vvh.validation_id and v.id = 23071
  ;

with tmp as (
  select distinct v.id, v.intervenant_id, v.histo_modification, vh.type_volume_horaire_id
  from validation v
  join validation_vol_horaire vvh on vvh.validation_id = v.id
  join volume_horaire vh on vvh.volume_horaire_id = vh.id and vh.histo_destruction is null
  where v.histo_destruction is null
), v as (
  select id, intervenant_id, histo_modification, count(type_volume_horaire_id)
  from tmp
  group by id, intervenant_id, histo_modification
  having count(type_volume_horaire_id) > 1
)
select ti.code, i.id intervenant_id, i.nom_usuel, i.prenom, v.id
from intervenant i
join statut_intervenant si on i.statut_id = si.id
join type_intervenant ti on si.type_intervenant_id = ti.id
join v on v.intervenant_id = i.id
order by i.nom_usuel, i.prenom
;

with tmp as (
  select distinct v.id, v.intervenant_id, v.histo_modification, vh.type_volume_horaire_id
  from validation v
  join validation_vol_horaire vvh on vvh.validation_id = v.id
  join volume_horaire vh on vvh.volume_horaire_id = vh.id and vh.histo_destruction is null
  where v.histo_destruction is null
), v as (
  select id validation_id, intervenant_id, histo_modification, count(type_volume_horaire_id)
  from tmp
  group by id, intervenant_id, histo_modification
  having count(type_volume_horaire_id) > 1
)
select vvh.volume_horaire_id, vh.type_volume_horaire_id, vvh.validation_id
from validation_vol_horaire vvh
join v on vvh.validation_id = v.validation_id
join volume_horaire vh on vvh.volume_horaire_id = vh.id
order by vvh.volume_horaire_id, vh.type_volume_horaire_id, vvh.validation_id
;

-- validation d'un VH précis
select vvh.validation_id, vh.type_volume_horaire_id, vvh.volume_horaire_id
from validation_vol_horaire vvh
join volume_horaire vh on vvh.volume_horaire_id = vh.id
where vh.id in (13)
order by vvh.validation_id, vh.type_volume_horaire_id
;

-- VUE de recherche des VH membres de plusieurs validations
--create or replace view tmp_vh_valides_plusieurs_fois as
with tmp as (
  select vh.id vh_id, count(vvh.validation_id)
  from volume_horaire vh
  join validation_vol_horaire vvh on vvh.volume_horaire_id = vh.id
  join validation v on vvh.validation_id = v.id and v.histo_destruction is null
  where vh.histo_destruction is null
  group by vh.id
  having count(vvh.validation_id) > 1
)
select vh.*, --, vvh.volume_horaire_id, vh.type_volume_horaire_id, vvh.validation_id, v.intervenant_id, v.histo_modification, v.histo_modificateur_id,
  DENSE_RANK() OVER (PARTITION BY vvh.volume_horaire_id ORDER BY v.histo_modification) rang -- numérotation des validations par ordre chronologique
from validation_vol_horaire vvh
join volume_horaire vh on vvh.volume_horaire_id = vh.id
join validation v on v.id = vvh.validation_id and v.histo_destruction is null
where vvh.volume_horaire_id in (select vh_id from tmp)
order by vvh.volume_horaire_id, v.id
;

select i.id intervenant_id, i.source_code, v.volume_horaire_id, val.id from validation val
join intervenant i on i.id = val.intervenant_id
join tmp_vh_valides_plusieurs_fois v on v.validation_id = val.id and v.rang > 1
;


select 'delete from validation_vol_horaire where volume_horaire_id = '||v.volume_horaire_id||' and validation_id = '||val.id||';'
from validation val
join intervenant i on i.id = val.intervenant_id
join tmp_vh_valides_plusieurs_fois v on v.validation_id = val.id and v.rang > 1
;



